const randomColor = () =>
	'#' + Math.floor(Math.random() * 16777215).toString(16)

export const Random = ({
	onRandom,
}: {
	onRandom?: (colors: LogoColors) => unknown
}) => {
	const [[background, keyword, value, token, resource, id], setColors] =
		useState<LogoColors>([
			randomColor(),
			randomColor(),
			randomColor(),
			randomColor(),
			randomColor(),
			randomColor(),
		])
	return (
		<>
			<Logo
				background={background}
				keyword={keyword}
				value={value}
				token={token}
				resource={resource}
				id={id}
			/>
			<p class="text-center mt-2">
				<button
					type="button"
					class="btn btn-outline-secondary"
					onClick={() => {
						const newColors: LogoColors = [
							randomColor(),
							randomColor(),
							randomColor(),
							randomColor(),
							randomColor(),
							randomColor(),
						]
						onRandom?.(newColors)
						setColors(newColors)
					}}
				>
					Click to generate a new variant
				</button>
			</p>
		</>
	)
}

